import React, { useState } from "react";


function ProfilePage() {
  const [availability, setAvailability] = useState({ value: true, label: "I'm available" });

  function handleToggleSwitch() {
    const newAvailability = { ...availability };
    newAvailability.value = !newAvailability.value;
    newAvailability.label = newAvailability.value ? "I'm available" : "I'm not available";
    setAvailability(newAvailability);
  }

  return (
    <div>
      <h1>User Profile</h1>
      <p>Profile information goes here...</p>
      <label>
        {availability.label}
        <input type="checkbox" checked={availability.value} onChange={handleToggleSwitch} />
      </label>
      {availability.value }
    </div>
  );
}

export default ProfilePage;
